import React from 'react';
import './NavBar.css';
import SearchBar from '../SearchBar/SearchBar';
import NavToggleButton from '../NavToggleButton/NavToggleButton';

onClickNave = (props) => {
    console.log('hi')
}


const NavBar = props => {

    return (
        <header className="navBar">
            <nav className="navBar__nav">
                <div className="navBar__toggleButton"><NavToggleButton  click={props.drawerClic}/></div>
                <div className="navBar__logo"><a href="/">Logo</a></div>
                <div className="speacer"></div>
                <div className="navBar__navItems">
                    <ul>
                        <li onClick={this.onClickNav}>New</li>
                        <li><a href="/">About Me</a></li>
                    </ul>

                </div>
            </nav>
        </header>
    )
}

export default NavBar;
